import React, { Component } from "react";
import DataService from "../services/remobidyc-server-services";
import axios from "axios";

class Register extends Component {
    constructor(props) {
        super(props);
        this.state = {
            username: '',
            model: '',
            progress: 0.0,
        };
        this.services = new DataService();
        this.handleInputChange = this.handleInputChange.bind(this);
    }

    handleInputChange(event) {
        const target = event.target;
        const value = target.value;
        const name = target.name;

        this.setState({
            [name]: value
        });
    }

    handleRegistration() {

        const simulation = JSON.stringify({
            username: this.state.username,
            model: this.state.model,
            progress: this.state.model

        });

        axios.post('http://localhost:2222/api/register/', {simulation}).then(res => { console.log(res); console.log(res.data) });

    }

    render() {
        return (


            <form onSubmit={this.handleRegistration}>
                <div class="form-group">
                    <label>
                        Username:
                        <input
                            name="username"
                            type="text"
                            checked={this.state.username}
                            onChange={this.handleInputChange}
                            class="form-control" />
                    </label>
                </div>
                <br />
                <div class="form-group">
                    <label>
                        Model:
                        <input
                            name="model"
                            type="text"
                            value={this.state.model}
                            onChange={this.handleInputChange}
                            class="form-control"
                        />
                    </label>
                </div>
                <br />
                <div class="form-group">
                    <label>
                        Progress:
                        <input
                            name="progress"
                            type="number"
                            value={this.state.progress}
                            onChange={this.handleInputChange}
                            class="form-control"
                            step="0.1"
                        />
                    </label>
                </div>
                <button type="submit" class="btn btn-primary">Submit</button>
            </form>
        );
    }
}

export default Register;
